data:
  definition: compteur de trafic affecté à un groupe de lignes pour enregistrer le
    nombre de tentatives d'appel qui n'ont pas trouvé de sorties libres
  examples: []
  notes:
  - Dans certains systèmes de commutation, chacun de ces appels déclenche un enregistrement
    individuel tandis que dans d'autres systèmes, deux ou plusieurs demandes simultanées
    de sortie non satisfaites sont enregistrées comme un seul cas de débordement.
